import detect from '../src/detect';

describe('detect', function() {
  it('should find an os and device for all agents', function () {

    browsers.forEach(function (browser) {
      var ua = detect.parse(browser[1]);
      assert.equal(browser[2], ua.browser.family || undefined);
      assert.equal(browser[3], ua.browser.version || undefined);
      assert.equal(browser[4], ua.os.family || undefined);
      assert.equal(browser[5], ua.os.version || undefined);
    });
  });
});

